    rem,
  } from "@mantine/core";
const index = () => {
  return (
    <>
      <AppShellDemo />
      <Grid>
      <Grid.Col span={4}>1</Grid.Col>
      <Grid.Col span={4}>2</Grid.Col>
      <Grid.Col span={4}>3</Grid.Col>
    </Grid>
    </>
  );
};

export default index;
